import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1 1" {...props} />;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 width="1px" height="1px" viewBox="0 0 1 1" style="enable-background:new 0 0 1 1;" xml:space="preserve"><rect class="aw-theme-iconOutline" fill="none" width="0" height="0"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
